import React from 'react'
import '../styling/badges.css'

const Badges = ({ userChart }) => {
  return (
    <div className='badges-container'>
        <div className='label'>
            <h1>Badges</h1>
        </div>
        <div className='badges-list'>
          {userChart}
        </div>
    </div>
  )
}

export default Badges
